import React from 'react';
import Product from '../Components/Product.json';

class ProductBody extends React.Component {
    render() {
        return (
            <div>
            {Product.map((productDetail, index) => {
                return (
                    <div>
                        <img>{productDetail.img}</img>
                    </div>
                )

            })}
            </div>
        )
    }
}

export default ProductBody;
